<div id="link-container"></div>

<script>

  const files = ["AMD_F.html", "EEM_EFA.html", "EEM_XLF.html", "F_KEY.html", "F_NKE.html", 
                 "F_TSM.html", "FXI_XLF.html", "GOOGL_AMZN.html", "KR_PYPL.html", "MSFT_F.html", "PFE_FXI.html", 
                 "PYPL_AAPL.html", "TSLA_F.html", "VWO_EEM.html", "VWO_FXI.html", "VWO_PFE.html", "VWO_XLF.html"];

  const container = document.getElementById("link-container");

  files.forEach(file => {
    const link = document.createElement("a");

</script>
